			text-align: center;
			font-size: 12px;
			height: 22px;
			margin-top: 3px;
		}

		.branch-switcher input:checked +label {
			background-color: #3399FF;
			border: 1px solid #3399FF;
			color: #fff;
			cursor: default;
		}

