			background-color: #fff;
			color: #066397;
			box-sizing: border-box;
		}

		.branch-switcher label:first-of-type {
			border-radius: 0px 3px 3px 0px;
			border-left: none;
		}

		.branch-switcher label:last-of-type {
			border-radius: 3px 0px 0px 3px;
			border-right: none;
		}

		.branch-switcher label:hover {
			border: 1px solid #066397;
		}

		.branch-switcher label:first-of-type:hover {
			border-left: none;
		}

		.branch-switcher label:last-of-type:hover {
			border-right: none;
		}

		.branch-switcher input:checked +label:hover  {
			border: 1px solid #3399FF;
