<style>.cover {
  position: absolute;
  width: 100%;
  height: 100%;
  z-index: 10000;
  left: 0;
  top: 0;
  background: black;
  opacity: 0.35;
  filter:alpha(opacity=35);
}

.cover.solid-overlay {
  background: #a6a6a6;
  opacity: 1;
  -moz-opacity: 1;
  filter: alpha(opacity=100);
}

.cover-invisible {
  opacity: 0;
}
.cover-invisible > .cover {
  opacity: 0;
}

.initial-progress {
  width: 320px;
  height: 160px;
  left: 50%;
  top: 50%;
  position: absolute;
  -moz-transform: translate(-50%, -50%); /* Firefox */
  -ms-transform: translate(-50%, -50%); /* IE */
  -webkit-transform: translate(-50%, -50%); /* Safari, Chrome, iOS */
  -o-transform: translate(-50%, -50%); /* Opera */
  transform: translate(-50%, -50%);
  line-height: 130px;
  color: #808080;
  border-radius: 4px;
  opacity: 1;
  filter:alpha(opacity=100);
  z-index: 10001;
}

