	display: block;
	padding: 0.5rem 1rem;
	box-sizing: border-box;
	height: 85px;
}
.initial-progress > .loading-text-container::before {
	content: '';
	display: inline-block;
	height: 100%;
	vertical-align: bottom;
}
.initial-progress > .loading-text-container > .loading-text {
	display: inline-block;
	vertical-align: bottom;
	font-weight: bold;
}
